import Post from "../Post/Post"
import "./feed.css"
import {useSelector, useDispatch} from "react-redux" 
import {useState} from "react"
import {getPostsOfFollowings} from "../../redux/actions/postAction"

const Feed = () => {
    const dispatch = useDispatch()
    // we are collecting all posts of people whom we have followed
    const getAllPostsOfFollowing = useSelector(state => state.posts)
    // const {posts} = getAllPostsOfFollowing;

    console.log(getAllPostsOfFollowing.posts[0]._id)

    useEffect(() => {
        dispatch(getPostsOfFollowings());
    }, [dispatch])
    return (
        <div>
            <div className="feed">
                {getAllPostsOfFollowing.posts.map((post) => (
                    <>
                        <Post key={post._id} post={post} />
                    </>
                ))}
            </div>
        </div>
    )
}

export default Feed
